import persoinimg from './persoin.png';
const Detailes = () => {



    return (

        <div className="detales">
            <h4>Name DR:</h4>
            <div class="flip-card">
                <div class="flip-card-inner">
                    <div class="flip-card-front">
                        <img src={persoinimg} alt="Avatar" className='persoinimg' />
                    </div>
                    <div class="flip-card-back">
                        <h1>John Doe</h1>
                        <p>Architect & Engineer</p>
                        <p>We love that guy</p>
                    </div>
                </div>
            </div>
            <h4>Location:</h4>
            <h4>working hours:</h4>





        </div>


    );
}
export default Detailes;
